import React, { useEffect } from 'react';
import './App.css';
import myImage from './CsumbClasses.png';
import myImage2 from './CsumbClasses2.png';
import PDFViewer from './PDFViewer'; // Import PDFViewer component

function CST300() {
    useEffect(() => {
        const h1Element = document.querySelector(".CST300 h1");
        if (h1Element) {
            setTimeout(() => {
                h1Element.style.color = "blue";
                h1Element.style.textShadow = `
          0 0 20px #00f,
          0 0 40px #00f,
          0 0 60px #00f
        `;
            }, 100);
        }
    }, []);

    return (
        <div className="CST300">
            <h1>CST 300 Major Pro Seminar</h1>
            <p>
                Course Objective: ... (Your text here)
            </p>
            <a
                href="https://play.google.com/store/apps/details?id=com.csu.module8finalproject"
                target="_blank"
                rel="noopener noreferrer"
            >
                <img
                    src={myImage}
                    alt="Classes App"
                    style={{ width: "100%", height: "auto", marginBottom: "30px" }}
                />
            </a>
            <p>
                Below is an example of the code used to create the application.
                <img
                    src={myImage2}
                    alt="Classes App2"
                    style={{ width: "100%", height: "auto", marginTop: "30px" }}
                />
            </p>

            {/* Insert the PDF Viewer here */}
            <PDFViewer />
        </div>
    );
}

export default CST300;
